import QuoteList from "../components/quotes/QuoteList";

const DUMMY_QUOTES = [
    {
        id: 'q1',
        author: 'Max',
        text: "Learning React is fun!"
    },
    {
        id: 'q2',
        author: 'Max min',
        text: "Learning JS is fun!"
    },
    {
        id: 'q3',
        author: 'Mami',
        text: "Learning React is happy!"
    }
]

function AllQuotes() {
    return ( 
        <QuoteList quotes={DUMMY_QUOTES} />
);
}

export default AllQuotes;
